import React from 'react';
import '../../App.css';
import HeroSection from '../HeroSection';
import Footer from '../Footer';

function Policies() {
  return (
    <>
      <HeroSection />
      <h1 className="AppQ1">Policies</h1>
      <br></br>
      <br></br>
      <ul class="PQ1">
         <li>Policies 1 </li><br></br>
         <li>Policies 2 </li>
         <li>Policies 3 </li>
         <li>Policies 4 </li>
         <li>Policies 5 </li>
         <li>Policies 6 </li>
         <li>Policies 7 </li>
         <li>Policies 8 </li>
         <li>Policies 9 </li>
         <li>Policies 10 </li>
         <li>Policies 11 </li>
         <li>Policies 12 </li>
      </ul><br></br>
      <Footer />
    </>
  );
}

export default Policies;
